INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES ("はい、お疲れさま。\nここではマスタリーチケットを\n使って、マスタリー強化素材を\n手に入れることができるわよ。", 0, 46001, 46, "2015/12/17 15:00:00", 0.0, "2030/12/17 14:59:59", 1, 123001, "アメス", -371.5, 0.0, 1, 1, 0);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES ("呼ばれて飛び出てお姉ちゃんだよ♪\nたとえ火の中、水の中、迷宮の中っ\nこのダンジョンを踏破できるよう\n弟くんを応援してあげるからねっ♪", 0, 47001, 47, "2015/12/17 15:00:00", 0.0, "2030/12/17 14:59:59", 2, 104901, "シズル", -416.5, 0.0, 1, 2, 0);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES ("ほんとーに不思議な場所ですね～\nお兄ちゃんが冒険を頑張れるよう\nおまじないをかけてあげますねっ\nフレーフレー、お・兄・ちゃんっ♪", 0, 47002, 47, "2015/12/17 15:00:00", 9.32, "2030/12/17 14:59:59", 2, 101101, "リノ", -416.5, 0.0, 1, 1, 0);
